import React from "react";

const TopNews = ({ title, news_url, image_url, text, date }) => {
    return (
        <div style>
            <a href={news_url} target="_blank">
                <img src={image_url} alt="New Image" />
            </a>
            <h3>
                <a href={news_url} target="_blank">{title}</a>
            </h3>
            <p>{text}</p>
            <p>{date}</p>
        </div>
    );
};

export default TopNews;
